import React, { Component } from "react";
import { connect } from "react-redux";
import { Routes, Route, Link, useLocation } from "react-router-dom";
import logo from "./assets/img/ggc_logo_dropshadow.png";

import home_logo from "./assets/img/home_black.svg"

import Login from "./views/aa_login/Login";
import Home from "./views/aa_login/Home";
import Profile from "./views/aa_login/Profile";
import BoardUser from "./views/aa_login/BoardUser";
import BoardModerator from "./views/aa_login/BoardModerator";
import BoardAdmin from "./views/aa_login/BoardAdmin";
import GGCApp from "./App copy"

import { logout } from "./store/auth";
import { clearMessage } from "./store/message";
import {NavBarButtonActive, NavBarButton} from "./views/nav/Navbar"



import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Dashboard from "./views/dashboard/Dashboard";
import MainOrderView_Tabs from "./views/orders/MainOrderView_Tabs";
import Search from "./views/search/Search";



// For Navigation
export const ViewIndex = {
	DASHBOARD: 1,
	ORDERS: 2,
	SEARCH: 4,
	HELP: 5,
	LOGOUT: 6,
  TEST: 7
}

export const PermissionTypes = {
	ADMIN: "ADMIN",
	GGC: "GGC",
	FARM: "FARM"
  // Potential for more permissions here
} 

export const InvoiceStatus = {
	MISSING: "Missing",
	WAITING: "Waiting",
	SENT: "PaymentSent",
  RECIEVED: "PaymentRecieved"
} 

export const OrderStatus = {
	PLACED: "Missing",
	PROCESSED: "Waiting",
	SHIPPED: "Shipped",
  COMPLETE: "Complete",
  ARCHIVE: "Archive"
} 

class App extends Component {
  constructor(props) {
    super(props);

    this.logOut = this.logOut.bind(this);

    this.state = {

      showModeratorBoard: false,
      showAdminBoard: false,

      userPermission: PermissionTypes.LOGGEDOUT,
      activeUser: null
    };
  }

  componentDidMount() {
    const {location} = this.props;

    if (["/login"].includes(location.pathname)) {
      this.props.clearMessage(); // clear message when changing location
    }
  }

  logOut() {
    this.props.logout();
  }

  componentDidUpdate(prevProps, prevState) {
    const { auth } = this.props;
    console.log(auth)
    console.log(auth.isLoggedIn)

    if (auth.isLoggedIn) {

      console.log("user exists!!")
      console.log(auth.user)

      this.setState({
        activeUser: auth.user,
        showModeratorBoard: (auth.user.permissionType === PermissionTypes.FARM.toString()),
        //showAdminBoard: (auth.user.permissionType === PermissionTypes.ADMIN.toString()),
      });
    } else {
      console.log("user doesnt exist?")
      this.setState({
        showModeratorBoard: false,
        showAdminBoard: false,
      });
    }
  }

  render() {
    const { showModeratorBoard, showAdminBoard } = this.state;
    const { user } = this.props.auth;
    const {activeUser} = this.state;
    console.log(this.props)

    return (

        <div>
      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <Link to={"/"} className="navbar-brand">
          <img alt='logo' src={logo} height='200' width='200' />
          <h2>G.O.A.T.S.</h2>
        </Link>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/home"} className="nav-link">
              Home
            </Link>
          </li>

          {showModeratorBoard && (
            <li className="nav-item">
              <Link to={"/mod"} className="nav-link">
                Farm Board
              </Link>
            </li>
          )}

          {showAdminBoard && (
            <li className="nav-item">
              <Link to={"/admin"} className="nav-link">
                Admin Board
              </Link>
            </li>
          )}

          {activeUser && (
            <li className="nav-item">
              <Link to={"/user"} className="nav-link">
                User
              </Link>
            </li>
          )}
        </div>

        {activeUser ? (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to={"/profile"} className="nav-link">
                {activeUser.nickname}
              </Link>
            </li>
            <li className="nav-item">
              <a href="/login" className="nav-link" onClick={this.logOut}>
                LogOut
              </a>
            </li>
          </div>
        ) : (
          <div className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to={"/login"} className="nav-link">
                Login
              </Link>
            </li>

            <li className="nav-item">
              <Link to={"/register"} className="nav-link">
                Sign Up
              </Link>
            </li>
          </div>
        )}
      </nav>

       <div className="container mt-3">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/home" element={<Dashboard />} />
          <Route path="/login" element={<Login />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/user" element={<BoardUser />} />
          <Route path="/farm" element={<BoardModerator />} />
          <Route path="/admin" element={<BoardAdmin />} />
          {/* <Route path="/GGCHome" element={<GGCApp/>}/> */}
          <Route path="/orders" element={<MainOrderView_Tabs/>}/>
          <Route path="/search" element={<Search/>}/>
          <Route path="/help" element={<Dashboard/>}/>
        </Routes>
      </div>

    </div>
  );
};
}

const mapStateToProps = (state) => {
    return {
      users: state.users,
      auth: state.auth,
      location: state.router.location
    };
  };

export default connect(mapStateToProps, { logout, clearMessage})(App);
